/* global fxrand fxhash cloud1 water1 Image fetch */
const ratio = 1.41
const features = {}
let lastTick = new Date().getTime()
const startTime = new Date().getTime()
let timePassed = 0
let speedMod = 1
let paused = false
let highRes = false
let showNoise = false
let goingDown = false
let sunMoonPhase = 'sun'
let lastSunPosition = null
let currentPalette = 1
const altPalette = 2
const vaporPalette = 3
let cloudLoaded = false
let waterLoaded = false
let noiseLoaded = false
window.$fxhashFeatures = {}

const makeFeatures = () => {
  //  These are the combinations of the land we can get, along with the % chance of getting it picked
  const lands = {
    SLLC: 25,
    SSLC: 50,
    SLCC: 25
  }

  const landscape = {
    SLLC: 'Sky, Land, Land, Sea',
    SSLC: 'Sky, Sky, Land, Sea',
    SLCC: 'Sky, Land, Sea, Sea'
  }

  const paletteName = {
    1: 'Monochromatic',
    2: 'Landscape',
    3: 'Vapor',
    4: 'Desolate',
    5: 'Abstract',
    6: 'Ice'
  }

  /*
  const lands = {
    'SSCC': 100
  }
  */

  const palette = ['dark', 'medium', 'light']
  features.speed = {
    fast: 300,
    medium: 700,
    slow: 1500
  }

  const palettes = {
    England: {
      shade: '#65041E',
      dark: '#AB0733',
      medium: '#BD0419',
      light: '#FC0000'
    },
    Wales: {
      shade: '#6B2D12',
      dark: '#F78D00',
      medium: '#E8A730',
      light: '#F1D726'
    },
    Scotland: {
      shade: '#212F80',
      dark: '#4630CD',
      medium: '#3633DD',
      light: '#5771FF'
    },
    Ireland: {
      shade: '#0000FF',
      dark: '#008C28',
      medium: '#00B441',
      light: '#78D100'
    }
  }

  //  Landscape
  const altPalette1 = {
    S: {
      shade: '#212F80',
      dark: '#98a1cb',
      medium: '#d1c1e0',
      light: '#ffc5d1'
    },
    L: {
      shade: '#0000FF',
      dark: '#008C28',
      medium: '#00B441',
      light: '#78D100'
    },
    C: {
      shade: '#6c9cd2',
      dark: '#03045e',
      medium: '#00b4d8',
      light: '#caf0f8'
    },
    sun: {
      dark: '#FFD460',
      medium: '#FFD460',
      light: '#FFD460'
    }
  }

  //  Vaporwave 1
  const altPalette2 = {
    S: {
      shade: '#212F80',
      dark: '#E83070',
      medium: '#F9767A',
      light: '#F6C03B'
    },
    L: {
      shade: '#000000',
      dark: '#56027A',
      medium: '#B402B7',
      light: '#E954E0'
    },
    C: {
      shade: '#000000',
      dark: '#3B8DBF',
      medium: '#4AB9EB',
      light: '#78FFFF'
    },
    sun: {
      dark: '#FFFF00',
      medium: '#FFFF00',
      light: '#FFFF00'
    }
  }

  //  Desolate
  const altPalette3 = {
    S: {
      shade: '#212F80',
      dark: '#2C3E51',
      medium: '#759DBE',
      light: '#CBDEE7'
    },
    L: {
      shade: '#5B5534',
      dark: '#5B5534',
      medium: '#7F734B',
      light: '#A69A72'
    },
    C: {
      shade: '#8CB4B7',
      dark: '#5E818D',
      medium: '#75B19F',
      light: '#8CB4B7'
    },
    sun: {
      dark: '#EDEDC1',
      medium: '#EDEDC1',
      light: '#EDEDC1'
    }
  }

  //  Absract
  const altPalette4 = {
    S: {
      shade: '#212F80',
      dark: '#2C3E51',
      medium: '#B5182A',
      light: '#587165'
    },
    L: {
      shade: '#5B5534',
      dark: '#8642C3',
      medium: '#D28F47',
      light: '#A69A72'
    },
    C: {
      shade: '#FFFF00',
      dark: '#660000',
      medium: '#339900',
      light: '#A3B9BA'
    },
    sun: {
      dark: '#EDEDC1',
      medium: '#EDEDC1',
      light: '#EDCC3D'
    }
  }

  //  Ice
  const altPalette5 = {
    S: {
      shade: '#212F80',
      dark: '#B4BFCE',
      medium: '#DEE1E8',
      light: '#E4E7ED'
    },
    L: {
      shade: '#CFE7F4',
      dark: '#769AAF',
      medium: '#9AB5C4',
      light: '#CFE7F4'
    },
    C: {
      shade: '#E4E7ED',
      dark: '#E4E7ED',
      medium: '#7DB3BA',
      light: '#A6D9D4'
    },
    sun: {
      dark: '#EDEDC1',
      medium: '#EDEDC1',
      light: '#F7F5F5'
    }
  }

  const runSimulation = false
  let dropSize = 1
  let simTimes = 1
  const tally = {}
  let tallyTotal = 0
  for (const land in lands) {
    tally[land] = 0
  }
  let thisLand = null

  //  For fun we are going to simulate running the drop a few times to we can see how the actual
  //  land numbers fall out
  if (runSimulation) {
    dropSize = 256
    simTimes = 100
  }

  //  Run the simulation
  for (let l = 0; l < dropSize * simTimes; l++) {
    const landChance = Math.floor(fxrand() * 100)
    thisLand = null
    let total = 0
    for (const land in lands) {
      if (landChance >= total) thisLand = land
      total += lands[land]
    }
    tally[thisLand] += 1 / simTimes
    tallyTotal += 1 / simTimes
  }
  const finalTally = []
  for (const t in tally) {
    finalTally.push({
      land: t,
      appears: parseFloat(tally[t].toFixed(2)),
      percent: parseFloat((tally[t] / tallyTotal * 100).toFixed(2))
    })
  }
  if (runSimulation) {
    console.log(`On a drop size of ${dropSize} this is how many times each land will statistically appear.
S = Sky
L = Land
C = Sea`)
    console.table(finalTally)
  }

  //  Now we figure out which country we are in
  const countryChance = fxrand()
  let country = 'England'
  if (countryChance < 0.75) country = 'Wales'
  if (countryChance < 0.5) country = 'Scotland'
  if (countryChance < 0.25) country = 'Ireland'

  //  Work out if we should pick a different palette
  if (fxrand() < 0.15) {
    const palChoice = fxrand()
    currentPalette = 2
    if (palChoice < 0.6) currentPalette = 3
    if (palChoice < 0.3) currentPalette = 4
    if (palChoice < 0.1) currentPalette = 6
  }
  //  If we have the vaporwave or ice pallet then turn noise on my default
  if (currentPalette === 3 || currentPalette === 6) showNoise = true
  //  Have a chance to toggle the noise
  if (fxrand() < 0.18) showNoise = !showNoise

  features.land = thisLand
  features.country = country
  features.palette = palette
  features.palettes = palettes
  features.altPalette1 = altPalette1
  features.altPalette2 = altPalette2
  features.altPalette3 = altPalette3
  features.altPalette4 = altPalette4
  features.altPalette5 = altPalette5

  //  Set the limited 
  window.$fxhashFeatures = {
    country: features.country,
    landscape: landscape[features.land],
    palette: paletteName[currentPalette],
    noisy: showNoise
  }

  features.strips = [
    [],
    [],
    [],
    []
  ]

  /* #########################################################################
   *
   * SKY
   *
   * ###################################################################### */
  let thisColour = 'dark'
  let oldColour1 = 'dark'
  let oldColour2 = null
  for (const i in features.land) {
    //  If this thing is a sky, then we do sky things
    if (features.land[i] === 'S') {
      //  Sometimes we will have 1 curve, other times 3, but most of the time we'll have 2
      let target = 2
      if (fxrand() < 0.5) {
        target = 3
        if (fxrand() < 0.1) target = 1
      }

      //  Reset for next strip
      thisColour = 'dark'
      oldColour1 = 'dark'
      oldColour2 = null

      //  I want to keep track of which starting (middle) and end points have been used
      //  so we don't use each one twice. There are a few ways of doing this, but I'm
      //  going to go for the fairly long-winded way of tracking them
      const started = []
      const ended = []

      //  Now we know how many curves there will be we need to make them
      for (let t = 0; t < target; t++) {
        const curve = {}
        //  Add the default features
        curve.mode = 'full'
        curve.flipped = true
        curve.textured = false
        curve.texture = 1

        //  The starting and ending postion can be in any of five points
        //  Top, Bottom, Middle and the two quarter points
        curve.start = Math.floor(fxrand() * 5) * 0.25
        curve.end = curve.start
        //  The end can't match the start
        while (curve.start === curve.end) curve.end = Math.floor(fxrand() * 5) * 0.25
        //  Now do it all over again, until we know we've used points that
        //  haven't already been used
        while (started.includes(curve.start) || ended.includes(curve.end)) {
          curve.start = Math.floor(fxrand() * 5) * 0.25
          curve.end = curve.start
          while (curve.start === curve.end) curve.end = Math.floor(fxrand() * 5) * 0.25
        }
        //  Record the start and end point so we don't use them again
        started.push(curve.start)
        ended.push(curve.end)

        //  Work out the colours
        while (thisColour === oldColour1 || thisColour === oldColour2) {
          thisColour = features.palette[Math.floor(fxrand() * features.palette.length)]
        }
        oldColour2 = oldColour1
        oldColour1 = thisColour
        curve.colour = thisColour

        //  Store the curve
        features.strips[i].push(curve)
      }
      //  Sort them into "largest" to "smallest", so we draw back to front
      features.strips[i] = features.strips[i].sort((a, b) => ((a.start + a.end) < (b.start + b.end)) ? 1 : (((b.start + b.end) < (a.start + a.end)) ? -1 : 0))
    }
  }

  //  If we have two skys, then the first one needs to be marked as not flipped,
  //  and we need to check to see if they have matching middle colours
  // let middleHappened = false
  if (features.land[0] === 'S' && features.land[1] === 'S') {
    for (const cloud of features.strips[0]) {
      cloud.flipped = false
    }

    //  Check to see the final cloud of the top strip is the same colour as the
    //  final cloud of the bottom strip, if so texture them.
    if (features.strips[0][features.strips[0].length - 1].colour === features.strips[1][features.strips[1].length - 1].colour) {
      features.strips[0][features.strips[0].length - 1].textured = true
      features.strips[1][features.strips[1].length - 1].textured = true
      // middleHappened = true
    }
  }

  for (const strip in features.land) {
    if (features.land[strip] === 'S') {
      let first = null
      let second = null
      let third = null
      if (features.strips[strip][0]) first = features.strips[strip][0]
      if (features.strips[strip][1]) second = features.strips[strip][1]
      if (features.strips[strip][2]) third = features.strips[strip][2]

      //  If there are three skies and NONE of them are textured, then we may texture some of them
      if (third !== null && second !== null && !first.textured && !second.textured && !third.textured) {
        const textureChance = fxrand()
        if (textureChance < 0.5) second.textured = true
        if (textureChance > 0.75) first.textured = true
      }

      //  If there are two skies, we _may_ shade the outer one
      if (third === null && second !== null && !first.textured && !second.textured) {
        if (fxrand() < 0.6) first.textured = true
      }

      //  Set the speeds
      if (!third && !second) first.speed = 'fast'
      if (!third && second && first) {
        first.speed = 'medium'
        second.speed = 'fast'
      }
      if (third && second && first) {
        first.speed = 'slow'
        second.speed = 'medium'
        third.speed = 'fast'
      }
    }
  }

  /* #########################################################################
   *
   * SEA
   *
   * ###################################################################### */
  // const seaCount = 0

  //  Reset the colours, but this time we don't reset between strips
  thisColour = 'dark'
  oldColour1 = 'dark'
  oldColour2 = null
  for (const i in features.land) {
    //  If this thing is a sky, then we do sky things
    if (features.land[i] === 'C') {
      //  Work out how many cures we are going to have
      const target = 4

      //  I want to keep track of which starting (middle) and end points have been used
      //  so we don't use each one twice. There are a few ways of doing this, but I'm
      //  going to go for the fairly long-winded way of tracking them
      const started = []
      const ended = []

      //  Now we know how many curves there will be we need to make them
      for (let t = 0; t < target; t++) {
        const curve = {}
        //  Add the default features
        curve.mode = 'full'
        curve.textured = false
        curve.texture = 1

        //  The starting and ending postion can be in any of five points
        //  Top, Bottom, Middle and the two quarter points
        curve.start = Math.floor(fxrand() * 5) * 0.25
        curve.end = curve.start
        //  The end can't match the start
        while (curve.start === curve.end) curve.end = Math.floor(fxrand() * 5) * 0.25
        //  Now do it all over again, until we know we've used points that
        //  haven't already been used
        while (started.includes(curve.start) || ended.includes(curve.end)) {
          curve.start = Math.floor(fxrand() * 5) * 0.25
          curve.end = curve.start
          while (curve.start === curve.end) curve.end = Math.floor(fxrand() * 5) * 0.25
        }
        //  Record the start and end point so we don't use them again
        started.push(curve.start)
        ended.push(curve.end)

        //  Store the curve
        features.strips[i].push(curve)
      }
      //  Sort them into "largest" to "smallest", so we draw back to front
      features.strips[i] = features.strips[i].sort((a, b) => ((a.start + a.end) < (b.start + b.end)) ? 1 : (((b.start + b.end) < (a.start + a.end)) ? -1 : 0))
      //  Now go through all of them turning the textured ones back into dark and adding the texture
      for (const wave of features.strips[i]) {
        if (wave.colour === 'textured') {
          wave.colour = 'dark'
          // wave.textured = true
        }
      }
    }
  }

  //  Work out where the shoreline is
  features.shore = 4
  if (features.land[0] !== 'C' && features.land[1] === 'C') features.shore = 1
  if (features.land[1] !== 'C' && features.land[2] === 'C') features.shore = 2
  if (features.land[2] !== 'C' && features.land[3] === 'C') features.shore = 3

  //  Now we do the land
  //  We are starting the colours *OUTSIDE* of the loop, so we can move from one to the next

  /* #########################################################################
   *
   * LAND
   *
   * ###################################################################### */

  // TODO: Calculate the top colour from the first strip of sea we have
  //  Reset the colours, but again don't reset between strips
  thisColour = 'dark'
  oldColour1 = 'dark'
  oldColour2 = null
  let landCount = 0
  for (const i in features.land) {
    //  If this thing is a sky, then we do sky things
    if (features.land[i] === 'L') {
      let target = 2
      if (fxrand() < 0.4) {
        target = 3
        if (fxrand() < 0.1) target = 1
      }

      //  I want to keep track of which starting (middle) and end points have been used
      //  so we don't use each one twice. There are a few ways of doing this, but I'm
      //  going to go for the fairly long-winded way of tracking them
      const started = []
      const ended = []

      //  Now we know how many curves there will be we need to make them
      for (let t = 0; t < target; t++) {
        const curve = {}
        //  Add the default features
        curve.mode = 'full'
        curve.flipped = false
        curve.textured = false
        curve.texture = 1

        //  The starting and ending postion can be in any of five points
        //  Top, Bottom, Middle and the two quarter points
        curve.start = Math.floor(fxrand() * 5) * 0.25
        curve.end = curve.start
        //  The end can't match the start
        while (curve.start === curve.end) curve.end = Math.floor(fxrand() * 5) * 0.25
        //  Now do it all over again, until we know we've used points that
        //  haven't already been used
        while (started.includes(curve.start) || ended.includes(curve.end)) {
          curve.start = Math.floor(fxrand() * 5) * 0.25
          curve.end = curve.start
          while (curve.start === curve.end) curve.end = Math.floor(fxrand() * 5) * 0.25
        }
        //  Record the start and end point so we don't use them again
        started.push(curve.start)
        ended.push(curve.end)

        //  Work out the colours
        while (thisColour === oldColour1 || thisColour === oldColour2) {
          thisColour = features.palette[Math.floor(fxrand() * features.palette.length)]
        }
        oldColour2 = oldColour1
        oldColour1 = thisColour
        curve.colour = thisColour

        if (fxrand() < 0.2) {
          curve.mode = 'half'
          curve.middle = curve.start
          if (fxrand() < 0.5) curve.middle = curve.end
        }

        //  Store the curve
        features.strips[i].push(curve)
        landCount++
      }
      //  Sort them into "largest" to "smallest", so we draw back to front
      features.strips[i] = features.strips[i].sort((a, b) => ((b.start + b.end) < (a.start + a.end)) ? 1 : (((a.start + a.end) < (b.start + b.end)) ? -1 : 0))
    }
  }

  //  Go through the lands now numbering them for darkness
  for (const i in features.land) {
    //  If this thing is a sky, then we do sky things
    if (features.land[i] === 'L') {
      for (const land of features.strips[i]) {
        land.darkness = --landCount
      }
    }
  }

  /* #########################################################################
   *
   * SEA TWO
   *
   * ###################################################################### */
  //  Now we want to colour the sea, but we need to work out a little bit of land first
  //  Now do the colours, starting from the top strip and working our way down the land
  //  grabbing the last colour used.
  thisColour = 'dark'
  oldColour1 = 'dark'
  oldColour2 = null
  for (const i in features.land) {
    //  If this thing is a sky, then we do sky things
    if (features.land[i] === 'L') {
      for (const land of features.strips[i]) {
        thisColour = land.colour
        oldColour1 = land.colour
        oldColour2 = null
      }
    }
  }

  for (const i in features.land) {
    //  If this thing is a sky, then we do sky things
    if (features.land[i] === 'C') {
      for (let w = features.strips[i].length - 1; w >= 0; w--) {
        //  Work out the colours
        while (thisColour === oldColour1 || thisColour === oldColour2) {
          thisColour = palette[Math.floor(fxrand() * palette.length)]
        }
        oldColour2 = oldColour1
        oldColour1 = thisColour
        features.strips[i][w].colour = thisColour
        if (fxrand() < 0.75) features.strips[i][w].textured = true
      }
    }
  }

  /* #########################################################################
   *
   * EXTRAS
   *
   * ###################################################################### */
  if (features.land !== 'SSCC') {
    let sunHeight = null
    if (features.land === 'SLLC') {
      sunHeight = 1
    }
    if (features.land === 'SSLC') {
      sunHeight = 2
    }
    if (features.land === 'SLCC') {
      sunHeight = 1
    }

    //  Keep track of the average start and end heights
    let skyStartHeight = 0
    let skyEndHeight = 0
    let landStartHeight = 0
    let landEndHeight = 0

    //  Go through the lowest sky strip
    for (const cloud of features.strips[sunHeight - 1]) {
      skyStartHeight += cloud.start
      skyEndHeight += cloud.end
    }
    skyStartHeight /= features.strips[sunHeight - 1].length
    skyEndHeight /= features.strips[sunHeight - 1].length

    //  Same again with the land
    for (const land of features.strips[sunHeight]) {
      landStartHeight += (1 - land.start)
      landEndHeight += (1 - land.end)
    }
    landStartHeight /= features.strips[sunHeight].length
    landEndHeight /= features.strips[sunHeight].length

    //  Now score them up to work out how far across to put the sun
    let skyPosition = 0.5
    if (skyStartHeight < skyEndHeight) skyPosition = 0.25
    if (skyStartHeight > skyEndHeight) skyPosition = 0.75

    let landPosition = 0.5
    if (landStartHeight < landEndHeight) landPosition = 0.25
    if (landStartHeight > landEndHeight) landPosition = 0.75

    //  Turn this into the Sun X Position
    const sunPosition = {
      x: (skyPosition + landPosition) / 2,
      strip: sunHeight,
      size: ((1 - skyStartHeight) + (1 - skyEndHeight) + (1 - landStartHeight) + (1 - landEndHeight)) / 4
    }
    features.sunPosition = sunPosition
  }

  /* #########################################################################
   *
   * Scenery
   *
   * ###################################################################### */
  features.scenery = []
  const usedPositions = [4]
  //  Decide if we are going to put something onto the shoreline
  let hasShorelineScenery = false
  if (fxrand() < 0.75) {
    hasShorelineScenery = true
    const newScenery = {
      type: 'house',
      position: 4,
      strip: features.shore,
      light: 'left',
      isShoreline: true,
      door: 'none'
    }
    //  Maybe pick something else
    const treeChance = fxrand()
    if (treeChance < 0.5) newScenery.type = 'tree1'
    if (treeChance < 0.25) newScenery.type = 'tree2'
    newScenery.count = Math.floor(fxrand() * 3 + 1) + Math.floor(fxrand() * 3 + 1)

    if (newScenery.type === 'house') {
      if (fxrand() < 0.5) {
        newScenery.door = 'left'
        if (fxrand() < 0.5) newScenery.door = 'right'
      }
    }

    //  Work out where to place it, that hasn't been placed already
    while (usedPositions.includes(newScenery.position)) newScenery.position = Math.floor(fxrand() * 7) + 1
    usedPositions.push(newScenery.position)
    //  Should the light come from the left or right?
    if (features.sunPosition.x > newScenery.position / 8) newScenery.light = 'right'
    features.scenery.push(newScenery)
  }

  //  Now go through the flat lands, working out if we want to place the things on there
  for (const s in features.strips) {
    for (const strip of features.strips[s]) {
      if (strip.mode === 'half') {
        //  Only do the thing if the flat part isn't along the shoreline
        if (!((parseInt(s, 10) + 1) === features.shore && strip.middle === 1 && hasShorelineScenery)) {
          if (fxrand() < 0.5) {
            const newScenery = {
              type: 'house',
              position: 4,
              strip: s,
              middle: strip.middle,
              light: 'left',
              isShoreline: false
            }
            //  Maybe pick something else
            const treeChance = fxrand()
            if (treeChance < 0.5) newScenery.type = 'tree1'
            if (treeChance < 0.25) newScenery.type = 'tree2'
            newScenery.count = Math.floor(fxrand() * 3 + 1) + Math.floor(fxrand() * 3 + 1)

            //  Work out where to place it, that hasn't been placed already
            //  If we have the flat part on the left
            if (strip.middle === strip.start && !(usedPositions.includes(1) && usedPositions.includes(2) && usedPositions.includes(3))) {
              while (usedPositions.includes(newScenery.position)) newScenery.position = Math.floor(fxrand() * 3) + 1
              usedPositions.push(newScenery.position)
              //  Should the light come from the left or right?
              if (features.sunPosition.x > newScenery.position / 8) newScenery.light = 'right'
              strip.scenery = newScenery
              features.scenery.push(newScenery)
            }
            //  If we have the flat part on the right
            if (strip.middle === strip.end && !(usedPositions.includes(5) && usedPositions.includes(6) && usedPositions.includes(7))) {
              while (usedPositions.includes(newScenery.position)) newScenery.position = Math.floor(fxrand() * 3) + 5
              usedPositions.push(newScenery.position)
              //  Should the light come from the left or right?
              if (features.sunPosition.x > newScenery.position / 8) newScenery.light = 'right'
              strip.scenery = newScenery
              features.scenery.push(newScenery)
            }
          }
        }
      }
    }
  }

  window.$fxhashFeatures.houses = 0
  window.$fxhashFeatures.copse = 0
  features.scenery.forEach((thing) => {
    if (thing.type === 'house') window.$fxhashFeatures.houses++
    if (thing.type === 'tree1') window.$fxhashFeatures.copse++
    if (thing.type === 'tree2') window.$fxhashFeatures.copse++
  })

}

makeFeatures()

const init = async () => {
  // autoDownloadCanvas()
  window.addEventListener('resize', async () => {
    await layoutCanvas()
    drawCanvas()
  })
  await layoutCanvas()
  drawCanvas()
}

const layoutCanvas = async () => {
  const wWidth = window.innerWidth
  const wHeight = window.innerHeight
  let cWidth = wWidth
  let cHeight = cWidth * ratio
  if (cHeight > wHeight) {
    cHeight = wHeight
    cWidth = wHeight / ratio
  }
  cHeight = Math.floor(cHeight / 8) * 8
  let bmWidth = cWidth

  const canvas = document.getElementById('target')
  if (highRes) {
    canvas.height = 4096
    canvas.width = 4096 / ratio
    bmWidth = 4096 / ratio
  } else {
    canvas.width = cWidth
    canvas.height = cHeight
  }
  canvas.style.position = 'absolute'
  canvas.style.width = `${cWidth}px`
  canvas.style.height = `${cHeight}px`
  canvas.style.left = `${(wWidth - cWidth) / 2}px`
  canvas.style.top = `${(wHeight - cHeight) / 2}px`

  //  Create the cloud canvas
  features.cloud1 = document.createElement('canvas')
  features.cloud1.id = 'cloud1src'
  features.cloud1.width = bmWidth / 6
  features.cloud1.height = bmWidth / 6
  const cloud1Ctx = features.cloud1.getContext('2d')
  cloud1Ctx.drawImage(features.cloud1img, 0, 0, 512, 512, 0, 0, features.cloud1.width, features.cloud1.height)
  features.cloud1pattern = cloud1Ctx.createPattern(features.cloud1, 'repeat')

  //  Create the water canvas
  features.water1 = document.createElement('canvas')
  features.water1.id = 'water1src'
  features.water1.width = bmWidth / 1
  features.water1.height = bmWidth / 2
  const water1Ctx = features.water1.getContext('2d')
  water1Ctx.drawImage(features.water1img, 0, 0, 512, 512, 0, 0, features.water1.width, features.water1.height)
  features.water1pattern = water1Ctx.createPattern(features.water1, 'repeat')

  //  Create the water canvas
  features.noise1 = document.createElement('canvas')
  features.noise1.id = 'noise1src'
  features.noise1.width = canvas.height / 8
  features.noise1.height = canvas.height / 2
  const noise1Ctx = features.noise1.getContext('2d')
  noise1Ctx.drawImage(features.noise1img, 0, 0, 256, 1024, 0, 0, features.noise1.width, features.noise1.height)
  features.noise1pattern = noise1Ctx.createPattern(features.noise1, 'repeat-x')

}

//  Draw the cloud for a strip
const drawCloud = (ctx, cloud, stripSize, edge, left, right, middle) => {
  const diff = timePassed

  let start = null
  let end = null
  let cmodmod = 1
  if (cloud.mode === 'half') cmodmod = 2

  if (!cloud.flipped) {
    edge += stripSize
    start = edge + (stripSize * -1) * cloud.start
    end = edge + (stripSize * -1) * cloud.end
  }

  if (cloud.flipped) {
    start = edge + (stripSize * 1) * cloud.start * 0.8
    end = edge + (stripSize * 1) * cloud.end * 0.8
  }

  //  Draw each one twice, but only do it the second time if we are textured
  let y = null
  for (let l = 0; l <= 1; l++) {
    if (l === 0 || (l === 1 && cloud.textured)) {
      ctx.fillStyle = features.palettes[features.country][cloud.colour]
      if (currentPalette === 2) ctx.fillStyle = features.altPalette1.S[cloud.colour]
      if (currentPalette === 3) ctx.fillStyle = features.altPalette2.S[cloud.colour]
      if (currentPalette === 4) ctx.fillStyle = features.altPalette3.S[cloud.colour]
      if (currentPalette === 5) ctx.fillStyle = features.altPalette4.S[cloud.colour]
      if (currentPalette === 6) ctx.fillStyle = features.altPalette5.S[cloud.colour]

      //  Set to default source over
      ctx.globalCompositeOperation = 'source-over'
      ctx.globalAlpha = 1.0

      //  If we are using a texture, do that now
      if (l === 1 && cloud.textured) {
        ctx.fillStyle = features.cloud1pattern
        ctx.globalCompositeOperation = 'lighter'
        ctx.globalAlpha = 0.5
        if (cloud.colour === 'dark') ctx.globalAlpha = 1.0
        if (cloud.colour === 'light') ctx.globalAlpha = 0.25
      }

      ctx.beginPath()
      ctx.moveTo(left, edge)
      //  Now we need to step through the points from the start to the end
      for (let i = 0; i <= 1.01; i += 0.01) {
        const cmod = (Math.sin(((180 * i * cmodmod) + (90 + diff / features.speed[cloud.speed])) * (Math.PI / 180)) + 1) / 2
        //  If we are drawing a full cloud then we have to do this
        y = end - ((end - start) * cmod)
        ctx.lineTo(left + ((right - left) * i), y)
      }
      // ctx.lineTo(right, y)

      ctx.lineTo(right, edge)
      ctx.closePath()
      ctx.fill()
      //  Reset it back
      ctx.globalCompositeOperation = 'source-over'
      ctx.globalAlpha = 1.0
    }
  }
  // ctx.stroke()
}

//  Draw a wave for a strip
const drawWave = (ctx, wave, stripSize, shore, top, left, right, middle) => {

  let start = null
  let end = null
  let cmodmod = 1
  if (wave.mode === 'half') cmodmod = 2

  start = top + (wave.start * stripSize)
  end = top + (wave.end * stripSize)
  if (wave.shrink) {
    start = top + (wave.start * 0.8 * stripSize)
    end = top + (wave.end * 0.8 * stripSize)
  }

  for (let l = 0; l <= 1; l++) {
    if (l === 0 || (l === 1 && wave.textured)) {
      //  Standard fill stuff
      ctx.fillStyle = features.palettes[features.country][wave.colour]
      if (currentPalette === 2) ctx.fillStyle = features.altPalette1.C[wave.colour]
      if (currentPalette === 3) ctx.fillStyle = features.altPalette2.C[wave.colour]
      if (currentPalette === 4) ctx.fillStyle = features.altPalette3.C[wave.colour]
      if (currentPalette === 5) ctx.fillStyle = features.altPalette4.C[wave.colour]
      if (currentPalette === 6) ctx.fillStyle = features.altPalette5.C[wave.colour]

      ctx.globalCompositeOperation = 'source-over'
      ctx.globalAlpha = 1.0

      //  If we are using a texture, do that now
      if (l === 1 && wave.textured) {
        ctx.fillStyle = features.water1pattern
        ctx.globalCompositeOperation = 'lighter'
        ctx.globalAlpha = 0.5
        if (wave.colour === 'dark') ctx.globalAlpha = 0.75
        if (wave.colour === 'light') ctx.globalAlpha = 0.25
      }

      ctx.beginPath()
      ctx.moveTo(left, shore)
      let y = end
      for (let i = 0; i <= 1; i += 0.01) {
        const cmod = (Math.sin(((180 * i * cmodmod) + 90) * (Math.PI / 180)) + 1) / 2
        y = end - ((end - start) * cmod)
        ctx.lineTo(left + ((right - left) * i), y)
      }
      ctx.lineTo(right, y)
      ctx.lineTo(right, shore)
      ctx.closePath()
      ctx.fill()
      //  Reset it back
      ctx.globalCompositeOperation = 'source-over'
      ctx.globalAlpha = 1.0
    }
  }
}

//  Draw the land for a strip
const drawLand = (ctx, canvas, land, stripSize, shore, bottom, left, right, middle) => {
  const start = bottom + (stripSize * land.start)
  const midd = bottom + (stripSize * land.middle)
  const end = bottom + (stripSize * land.end)
  let cmodmod = 1
  if (land.mode === 'half') cmodmod = 2

  let y = null
  for (let l = 0; l <= 3; l++) {
    if (l === 0 || (l === 1 && land.textured) || l === 2 || (l === 3 && showNoise)) {
      ctx.fillStyle = features.palettes[features.country][land.colour]
      if (currentPalette === 2) ctx.fillStyle = features.altPalette1.L[land.colour]
      if (currentPalette === 3) ctx.fillStyle = features.altPalette2.L[land.colour]
      if (currentPalette === 4) ctx.fillStyle = features.altPalette3.L[land.colour]
      if (currentPalette === 5) ctx.fillStyle = features.altPalette4.L[land.colour]
      if (currentPalette === 6) ctx.fillStyle = features.altPalette5.L[land.colour]

      //  Set to default source over
      ctx.globalCompositeOperation = 'source-over'
      ctx.globalAlpha = 1.0

      //  If we are on the third pass then add the darkness in
      if (l === 2) {
        ctx.fillStyle = 'black'
        ctx.fillStyle = features.palettes[features.country].shade
        ctx.globalAlpha = 0.08 * land.darkness
      }

      if (l === 3 && showNoise) {
        ctx.fillStyle = features.noise1pattern
        ctx.globalAlpha = 1
        ctx.globalCompositeOperation = 'soft-light'
        if (currentPalette === 3) {
          ctx.globalAlpha = 0.5
          ctx.globalCompositeOperation = 'multiply'
        }
        if (currentPalette === 5) {
          ctx.globalAlpha = 0.5
          ctx.globalCompositeOperation = 'hard-light'
        }
      }

      ctx.beginPath()
      ctx.moveTo(left, shore)
      let offsetY = 0
      //  Now we need to step through the points from the start to the end
      for (let i = 0; i <= 1; i += 0.01) {
        const cmod = (Math.sin(((180 * i * cmodmod) + 90) * (Math.PI / 180)) + 1) / 2
        //  If we are drawing a full land then we have to do this
        if (land.mode === 'full') {
          y = end - ((end - start) * cmod)
          ctx.lineTo(left + ((right - left) * i), y)
        } else {
          //  Otherwise we have to draw the first half of the land first and then
          //  the second half
          if (start !== midd) {
            if (i <= 0.5) {
              y = midd - ((midd - start) * cmod)
              ctx.lineTo((left + ((right - left) * i)), y)
            } else {
              y = end
              ctx.lineTo((left + ((right - left) * i)) + middle, y)
            }
          }
          if (midd !== end) {
            if (i <= 0.5) {
              y = midd
              ctx.lineTo((left + ((right - left) * i)), y)
            } else {
              y = midd - ((midd - end) * cmod)
              ctx.lineTo((left + ((right - left) * (i - 0.5))) + middle, y)
            }
          }
        }
        if (y > offsetY) offsetY = y
      }
      ctx.lineTo(right, y)

      ctx.lineTo(right, shore)
      ctx.closePath()

      if (l === 3 && showNoise) {
        ctx.save()
        if (start < end) {
          ctx.translate(0, start)
        } else {
          ctx.translate(0, end)
        }
      }
      ctx.fill()
      if (l === 3 && showNoise) {
        ctx.restore()
      }
      //  Reset it back
      ctx.globalCompositeOperation = 'source-over'
      ctx.globalAlpha = 1.0
    }
  }
  if (land.scenery) {
    if (land.scenery.type === 'tree1' || land.scenery.type === 'tree2') {
      drawTree(ctx, canvas.width, canvas.height, land.scenery)
    }
    if (land.scenery.type === 'house') {
      drawHouse(ctx, canvas.width, canvas.height, land.scenery)
    }
  }
}

const drawSun = (ctx, sun, width, stripSize) => {
  const sunLevel = stripSize * sun.strip + (stripSize * 1.5 * Math.sin(timePassed / 100000))
  let sizeMod = 1
  if (sunMoonPhase !== 'sun') sizeMod = 0.66

  ctx.fillStyle = features.palettes[features.country].dark
  if (features.country === 'England') ctx.fillStyle = features.palettes[features.country].light
  if (features.country === 'Ireland') ctx.fillStyle = features.palettes[features.country].light
  if (currentPalette === 2) ctx.fillStyle = features.altPalette1.sun.light
  if (currentPalette === 3) ctx.fillStyle = features.altPalette2.sun.light
  if (currentPalette === 4) ctx.fillStyle = features.altPalette3.sun.light
  if (currentPalette === 5) ctx.fillStyle = features.altPalette4.sun.light
  if (currentPalette === 6) ctx.fillStyle = features.altPalette5.sun.light

  ctx.beginPath()
  ctx.arc(width * sun.x, sunLevel, stripSize * sun.size * sizeMod * 0.8, 0, 2 * Math.PI)
  ctx.fill()

  ctx.fillStyle = 'white'
  ctx.globalAlpha = 0.25
  if (sunMoonPhase !== 'sun') ctx.globalAlpha = 0.75
  ctx.beginPath()
  ctx.arc(width * sun.x, sunLevel, stripSize * sun.size * sizeMod * 0.8, 0, 2 * Math.PI)
  if (currentPalette === 1 || sunMoonPhase !== 'sun') {
    ctx.fill()
  }

  ctx.globalAlpha = 1.0
}

const drawTree = (ctx, width, height, tree) => {
  let treeRadius = width / 80
  if (tree.type === 'tree2') treeRadius *= 0.8
  const spreadStep = treeRadius * 3
  const spreadStart = (tree.count - 1) * spreadStep / -2
  const xPos = width / 8 * tree.position
  let yPos = height / 4 * tree.strip
  let trunkBase = height / 4 * tree.strip
  let yMod = 1
  if (tree.type === 'tree1') {
    yPos += (treeRadius * 0.25)
  }
  if (tree.type === 'tree2') {
    yPos -= treeRadius
    yMod = 2
  }
  if (tree.middle) {
    yPos += (height / 4) * tree.middle
    trunkBase += (height / 4) * tree.middle
  }

  //  Now loop through the trees
  for (let i = 0; i < tree.count; i++) {

    //  Draw the trunk
    ctx.globalAlpha = 0.8
    ctx.strokeStyle = '#000'
    ctx.lineWidth = treeRadius / 2
    ctx.beginPath()
    ctx.moveTo(xPos + spreadStart + (spreadStep * i), trunkBase)
    ctx.lineTo(xPos + spreadStart + (spreadStep * i), yPos - (treeRadius * 2))
    ctx.stroke()
    ctx.strokeStyle = 'rgba(0, 0, 0, 0)'

    //  Draw the light side of the tree
    ctx.globalAlpha = 1.0
    ctx.fillStyle = features.palettes[features.country].light
    if (currentPalette === 2) ctx.fillStyle = features.altPalette1.L.light
    if (currentPalette === 3) ctx.fillStyle = features.altPalette2.L.light
    if (currentPalette === 4) ctx.fillStyle = features.altPalette3.L.light
    if (currentPalette === 5) ctx.fillStyle = features.altPalette4.L.light
    if (currentPalette === 6) ctx.fillStyle = features.altPalette5.L.light
    ctx.beginPath()
    if (tree.light === 'left') {
      ctx.ellipse(xPos + spreadStart + (spreadStep * i), yPos - (treeRadius * 2), treeRadius, treeRadius * yMod, 0, 0.5 * Math.PI, 1.5 * Math.PI)
    } else {
      ctx.ellipse(xPos + spreadStart + (spreadStep * i), yPos - (treeRadius * 2), treeRadius, treeRadius * yMod, 0, 1.5 * Math.PI, 0.5 * Math.PI)
    }
    ctx.fill()

    ctx.globalAlpha = 0.2
    ctx.fillStyle = 'white'
    ctx.fill()


    //  Now do the dark half
    ctx.globalAlpha = 1.0
    ctx.fillStyle = features.palettes[features.country].dark
    if (currentPalette === 2) ctx.fillStyle = features.altPalette1.L.dark
    if (currentPalette === 3) ctx.fillStyle = features.altPalette2.L.dark
    if (currentPalette === 4) ctx.fillStyle = features.altPalette3.L.dark
    if (currentPalette === 5) ctx.fillStyle = features.altPalette4.L.dark
    if (currentPalette === 6) ctx.fillStyle = features.altPalette5.L.dark
    ctx.beginPath()
    if (tree.light === 'left') {
      ctx.ellipse(xPos + spreadStart + (spreadStep * i), yPos - (treeRadius * 2), treeRadius, treeRadius * yMod, 0, 1.5 * Math.PI, 0.5 * Math.PI)
    } else {
      ctx.ellipse(xPos + spreadStart + (spreadStep * i), yPos - (treeRadius * 2), treeRadius, treeRadius * yMod, 0, 0.5 * Math.PI, 1.5 * Math.PI)
    }
    ctx.fill()

    ctx.globalAlpha = 0.2
    ctx.fillStyle = 'black'
    ctx.fill()

  }
}

const drawHouse = (ctx, width, height, house) => {
  let houseSize = width / 50
  const xPos = width / 8 * house.position
  let yPos = height / 4 * house.strip
  if (house.middle) yPos += (height / 4) * house.middle

  let medium = features.palettes[features.country].medium
  if (currentPalette === 2) medium = features.altPalette1.L.medium
  if (currentPalette === 3) medium = features.altPalette2.L.medium
  if (currentPalette === 4) medium = features.altPalette3.L.medium
  if (currentPalette === 5) medium = features.altPalette4.L.medium
  if (currentPalette === 6) medium = features.altPalette5.L.medium

  ctx.lineWidth = 2

  //  Do the left face
  ctx.globalAlpha = 1.0
  ctx.fillStyle = medium
  ctx.strokeStyle = medium

  ctx.beginPath()
  ctx.moveTo(xPos - (houseSize * 0.8), yPos)
  ctx.lineTo(xPos - (houseSize * 0.8), yPos - (houseSize * 0.7))
  ctx.lineTo(xPos, yPos - (houseSize * 1.2))
  ctx.lineTo(xPos + (houseSize * 0.8), yPos - (houseSize * 0.7))
  ctx.lineTo(xPos + (houseSize * 0.8), yPos)
  ctx.closePath()
  ctx.fill()
  ctx.globalAlpha = 0.5
  if (house.light === 'left') {
    ctx.fillStyle = 'white'
  } else {
    ctx.fillStyle = 'black'
  }
  ctx.fill()

  if (house.door === 'left') {
    ctx.globalAlpha = 1.0
    ctx.strokeStyle = '#000000'
    ctx.lineWidth = width / 200
    ctx.beginPath()
    ctx.moveTo(xPos, yPos)
    ctx.lineTo(xPos, yPos - houseSize * 0.3)
    ctx.stroke()
  }

  //  Do the right
  ctx.globalAlpha = 1.0
  ctx.fillStyle = medium
  ctx.strokeStyle = medium

  ctx.beginPath()
  ctx.moveTo(xPos + (houseSize * 0.8), yPos)
  ctx.lineTo(xPos + (houseSize * 0.8), yPos - (houseSize * 0.7))
  ctx.lineTo(xPos + (houseSize * 2), yPos - (houseSize * 0.7))
  ctx.lineTo(xPos + (houseSize * 2), yPos)
  ctx.closePath()
  ctx.fill()
  ctx.globalAlpha = 0.5
  if (house.light === 'right') {
    ctx.fillStyle = 'white'
  } else {
    ctx.fillStyle = 'black'
  }
  ctx.fill()

  if (house.door === 'right') {
    ctx.globalAlpha = 1.0
    ctx.strokeStyle = '#000000'
    ctx.lineWidth = width / 200
    ctx.beginPath()
    ctx.moveTo(xPos + (houseSize * 1.4), yPos)
    ctx.lineTo(xPos + (houseSize * 1.4), yPos - houseSize * 0.3)
    ctx.stroke()
  }

  //  Do the roof
  ctx.globalAlpha = 1.0
  ctx.fillStyle = '#000000'
  ctx.beginPath()
  ctx.moveTo(xPos, yPos - (houseSize * 1.2))
  ctx.lineTo(xPos + (houseSize * 2) - (houseSize * 0.8), yPos - (houseSize * 1.2))
  ctx.lineTo(xPos + (houseSize * 2), yPos - (houseSize * 0.7))
  ctx.lineTo(xPos + (houseSize * 0.8), yPos - (houseSize * 0.7))
  ctx.fill()

}

const drawCanvas = async () => {
  const canvas = document.getElementById('target')
  const ctx = canvas.getContext('2d')

  //  update the time passed
  //  We do it this way so we can speed up time if needed.
  if (!paused) timePassed -= (new Date().getTime() - lastTick) * speedMod * (1 * (1 + Math.abs(Math.sin(timePassed / 100000))))
  lastTick = new Date().getTime()

  ctx.globalCompositeOperation = 'source-over'
  ctx.globalAlpha = 1.0
  ctx.fillStyle = '#FFF'
  ctx.fillRect(0, 0, canvas.width, canvas.height)

  //  If we have an alternate palette then we may change the sky here
  if (currentPalette === 2) {
    const skyGrad = ctx.createLinearGradient(0, 0, 0, (features.shore - 1) * canvas.height / 4)
    skyGrad.addColorStop(0, '#a8dadc')
    skyGrad.addColorStop(1, '#f1faee')
    ctx.fillStyle = skyGrad
    ctx.fillRect(0, 0, canvas.width, canvas.height)
  }
  if (currentPalette === 3) {
    const skyGrad = ctx.createLinearGradient(0, 0, 0, (features.shore - 1) * canvas.height / 4)
    skyGrad.addColorStop(0, '#F72F96')
    skyGrad.addColorStop(1, '#2C2A56')
    ctx.fillStyle = skyGrad
    ctx.fillRect(0, 0, canvas.width, canvas.height)
  }
  if (currentPalette === 4) {
    const skyGrad = ctx.createLinearGradient(0, 0, 0, (features.shore - 1) * canvas.height / 4)
    skyGrad.addColorStop(0, '#404160')
    skyGrad.addColorStop(1, '#405160')
    ctx.fillStyle = skyGrad
    ctx.fillRect(0, 0, canvas.width, canvas.height)
  }
  if (currentPalette === 5) {
    const skyGrad = ctx.createLinearGradient(0, 0, 0, (features.shore - 1) * canvas.height / 4)
    skyGrad.addColorStop(0, '#CEDDE6')
    skyGrad.addColorStop(1, '#DCECF6')
    ctx.fillStyle = skyGrad
    ctx.fillRect(0, 0, canvas.width, canvas.height)
  }

  //  Work out how to colour the sky
  const satThreshold = 0.4
  let darkThreshold = 0.5
  if (lastSunPosition !== null) {
    const darkThreshold = 0.1
    if (lastSunPosition > darkThreshold || sunMoonPhase !== 'sun') {
      let darkenBy = (lastSunPosition - darkThreshold) / (1 - darkThreshold)
      if (sunMoonPhase !== 'sun') darkenBy = (1 - darkThreshold) / (1 - darkThreshold)
      ctx.globalCompositeOperation = 'darken'
      ctx.globalAlpha = darkenBy
      ctx.fillStyle = '#000000'
      ctx.fillRect(0, 0, canvas.width, canvas.height)
    }
  }
  //  Reset back to normal
  darkThreshold = 0.25
  ctx.globalCompositeOperation = 'source-over'
  ctx.globalAlpha = 1.0

  features.ctx = ctx

  //  Draw the sun
  if (features.sunPosition) drawSun(ctx, features.sunPosition, canvas.width, canvas.height / 4)

  //   DEAL WITH THE SKY FIRST
  for (let strip = 0; strip < 4; strip++) {
    //  Just to make things a little easier, let's work out where our
    //  corners are
    const stripSize = canvas.height / 4
    const top = stripSize * strip
    // const bottom = top + stripSize
    const left = 0
    const right = canvas.width
    const middle = canvas.width / 2

    //  If we are drawing the sky, do it one way
    //  otherwise keep going the old fashioned way
    if (features.land[strip] === 'S') {
      //  Loop through the curves drawing them
      for (const cloud of features.strips[strip]) {
        //  Now draw the cloud
        //  if we aren't the last sky, then draw the fills from the bottom of the
        //  strip up, otherwise draw them from the top of the strip down
        drawCloud(ctx, cloud, stripSize, top, left, right, middle)
      }
    }
  }

  //   NOW TO THE SEA
  ctx.fillStyle = features.palettes[features.country].dark
  if (currentPalette === 2) ctx.fillStyle = features.altPalette1.C.dark
  if (currentPalette === 3) ctx.fillStyle = features.altPalette2.C.dark
  if (currentPalette === 4) ctx.fillStyle = features.altPalette3.C.dark
  if (currentPalette === 5) ctx.fillStyle = features.altPalette4.C.dark
  if (currentPalette === 6) ctx.fillStyle = features.altPalette5.C.dark

  for (let strip = 3; strip >= 0; strip--) {
    //  Just to make things a little easier, let's work out where our
    //  corners are
    const stripSize = canvas.height / 4
    const shore = stripSize * features.shore
    const top = stripSize * strip
    const left = 0
    const right = canvas.width
    const middle = canvas.width / 2

    if (features.land[strip] === 'C') {
      //  If the last thing we drew was a textured pattern, then we need to fill
      //  the rectange in with dark blue first, and then over the top again with the
      // texture
      // let redrawTexture = false
      // if (typeof (ctx.fillStyle) === 'object') redrawTexture = true
      //  Draw the rectangle
      if (strip === 3) {
        ctx.fillStyle = features.palettes[features.country].dark
        if (currentPalette === 2) ctx.fillStyle = features.altPalette1.C.dark
        if (currentPalette === 3) ctx.fillStyle = features.altPalette2.C.dark
        if (currentPalette === 4) ctx.fillStyle = features.altPalette3.C.dark
        if (currentPalette === 5) ctx.fillStyle = features.altPalette4.C.dark
        if (currentPalette === 6) ctx.fillStyle = features.altPalette5.C.dark

        ctx.globalCompositeOperation = 'source-over'
        ctx.globalAlpha = 1.0
        ctx.fillRect(0, canvas.height / 4 * strip, canvas.width, canvas.height / 4)
      }

      //  Loop through the curves drawing them
      for (const wave of features.strips[strip]) {
        if (strip === 3) {
          wave.shrink = true
        }
        drawWave(ctx, wave, stripSize, shore, top, left, right, middle)
      }
    }
  }

  //  Now draw a gradient from the shoreline down to the bottom of the image
  const seaGrad = ctx.createLinearGradient(0, features.shore * canvas.height / 4, 0, canvas.height)
  if (currentPalette === 1) {
    seaGrad.addColorStop(0, features.palettes[features.country].dark)
    seaGrad.addColorStop(1, features.palettes[features.country].light)
  }
  if (currentPalette === 2) {
    seaGrad.addColorStop(0, features.altPalette1.C.dark)
    seaGrad.addColorStop(1, features.altPalette1.C.light)
  }
  if (currentPalette === 3) {
    seaGrad.addColorStop(0, features.altPalette2.L.dark)
    seaGrad.addColorStop(1, features.altPalette2.C.light)
  }
  if (currentPalette === 4) {
    seaGrad.addColorStop(0, features.altPalette3.C.dark)
    seaGrad.addColorStop(1, features.altPalette3.C.light)
  }
  if (currentPalette === 5) {
    seaGrad.addColorStop(0, features.altPalette4.C.dark)
    seaGrad.addColorStop(1, features.altPalette4.C.light)
  }
  if (currentPalette === 6) {
    seaGrad.addColorStop(0, features.altPalette5.C.dark)
    seaGrad.addColorStop(1, features.altPalette5.C.light)
  }

  ctx.fillStyle = seaGrad
  ctx.globalAlpha = 1
  ctx.globalCompositeOperation = 'darken'
  if (currentPalette !== 4) ctx.fillRect(0, features.shore * canvas.height / 4, canvas.width, canvas.height)
  ctx.globalCompositeOperation = 'source-over'
  ctx.globalAlpha = 1.0

  //   FINALLY THE LAND
  for (let strip = 0; strip < 4; strip++) {
    const stripSize = canvas.height / 4
    const shore = stripSize * features.shore
    const bottom = stripSize * (strip)
    const left = 0
    const right = canvas.width
    const middle = canvas.width / 2

    if (features.land[strip] === 'L') {
      for (const land of features.strips[strip]) {
        drawLand(ctx, canvas, land, stripSize, shore, bottom, left, right, middle)
      }
    }
  }

  const newSunPosition = Math.sin(timePassed / 100000)
  if (lastSunPosition !== null) {
    //  do direction check
    //  If we are going up...
    if (newSunPosition < lastSunPosition) {
      //  If we were going down, it means we have now switched to going up
      if (goingDown) {
        if (sunMoonPhase === 'sun') {
          sunMoonPhase = 'moon'
        } else {
          sunMoonPhase = 'sun'
        }
      }
      goingDown = false
    }

    if (newSunPosition > lastSunPosition) {
      goingDown = true
    }
  }
  lastSunPosition = newSunPosition

  //  Now place the scenery
  features.scenery.forEach((thing) => {
    //  Only draw the shoreline
    if (thing.isShoreline) {
      if (thing.type === 'tree1' || thing.type === 'tree2') {
        drawTree(ctx, canvas.width, canvas.height, thing)
      }
      if (thing.type === 'house') {
        drawHouse(ctx, canvas.width, canvas.height, thing)
      }
    }
  })

  //  Do the saturation
  if (lastSunPosition > satThreshold || sunMoonPhase === 'moon') {
    let saturationBy = (lastSunPosition - satThreshold) / (1 - satThreshold)
    if (sunMoonPhase === 'moon') saturationBy = (1 - satThreshold) / (1 - satThreshold)

    ctx.globalCompositeOperation = 'saturation'
    ctx.globalAlpha = saturationBy * 0.9
    ctx.fillStyle = '#999999'
    ctx.fillRect(0, 0, canvas.width, canvas.height)
  }

  if (lastSunPosition > darkThreshold) {
    const darkenBy = (lastSunPosition - darkThreshold) / (1 - darkThreshold)
    ctx.globalCompositeOperation = 'overlay'
    ctx.globalAlpha = darkenBy * 0.8
    ctx.fillStyle = '#000000'
    ctx.fillRect(0, 0, canvas.width, canvas.height)
  }

  // await autoDownloadCanvas()
  // document.location.reload()
  // return
  setTimeout(() => {
    // makeFeatures()
    drawCanvas()
  }, 66)
}

const autoDownloadCanvas = async (showHash = false) => {
  const element = document.createElement('a')
  element.setAttribute('download', `Landscape_${fxhash}`)
  element.style.display = 'none'
  document.body.appendChild(element)
  let imageBlob = null
  imageBlob = await new Promise(resolve => document.getElementById('target').toBlob(resolve, 'image/png'))
  element.setAttribute('href', window.URL.createObjectURL(imageBlob, {
    type: 'image/png'
  }))
  element.click()
  document.body.removeChild(element)
}

document.addEventListener('keypress', async (e) => {
  e = e || window.event

  //  Speed up
  if (e.key === '.') {
    speedMod *= 2
    if (speedMod > 32) speedMod = 32
  }
  //  Slow down
  if (e.key === ',') {
    speedMod /= 2
    if (speedMod < 1) speedMod = 1
  }
  // Pause
  if (e.key === ' ') {
    paused = !paused
  }
  // Noise
  if (e.key === 'n') {
    showNoise = !showNoise
  }
  // cycle palettes
  if (e.key === 'p') {
    currentPalette++
    if (currentPalette > 6) currentPalette = 1
  }
  // Save
  if (e.key === 's') autoDownloadCanvas()
  //   Toggle highres mode
  if (e.key === 'h') {
    highRes = !highRes
    await layoutCanvas()
    drawCanvas()
  }
})

let timeout = null
let lastTap = new Date().getTime()
document.addEventListener('touchend', (event) => {
  const currentTime = new Date().getTime()
  const tapLength = currentTime - lastTap
  clearTimeout(timeout)
  if (tapLength < 500 && tapLength > 0) {
    speedMod *= 2
    if (speedMod > 32) speedMod = 1
    event.preventDefault()
  } else {
    timeout = setTimeout(() => {
      currentPalette++
      if (currentPalette > 6) currentPalette = 1
      clearTimeout(timeout)
    }, 500);
  }
  lastTap = currentTime
})

//  This preloads the images so we can get access to them
const preloadImages = () => {
  // If the <img> don't exist in the DOM yet, then we add them
  let cloud1img = document.getElementById('cloud1Img')
  if (!cloud1img) {
    cloud1img = document.createElement('img')
    cloud1img.id = 'cloud1Img'
    cloud1img.style.width = '512px'
    cloud1img.style.height = '512px'
    cloud1img.addEventListener('load', () => {
      cloudLoaded = true
    })
    cloud1img.src = 'data:image/jpeg;base64,'
    features.cloud1img = cloud1img
  }

  let water1img = document.getElementById('water1Img')
  if (!water1img) {
    water1img = document.createElement('img')
    water1img.id = 'water1Img'
    water1img.style.width = '1024px'
    water1img.style.height = '512px'
    water1img.addEventListener('load', () => {
      waterLoaded = true
    })
    water1img.src = 'data:image/png;base64,'
    features.water1img = water1img
  }

  let noise1img = document.getElementById('noise1Img')
  if (!noise1img) {
    noise1img = document.createElement('img')
    noise1img.id = 'noise1Img'
    noise1img.style.width = '256px'
    noise1img.style.height = '1024px'
    noise1img.addEventListener('load', () => {
      noiseLoaded = true
    })
    noise1img.src = 'data:image/png;base64,'
    features.noise1img = noise1img
  }

  if (cloudLoaded && waterLoaded && noiseLoaded) {
    clearInterval(preloadImagesTmr)
    init()
  }

  //  If, for some reason things haven't fired after 3.333 seconds, then just draw the stuff anyway
  //  without the textures
  if (new Date().getTime() - startTime > 3333) {
    clearInterval(preloadImagesTmr)
    init()
  }
}

